$(document).on("click",".delete-survey",function(){let e=$(this);Swal.fire({title:"Sil!",text:"Silmek istediğinize emin misiniz?",imageUrl:"/assets/media/svg/illustrations/23.svg",imageWidth:400,imageHeight:200,imageAlt:"Custom image",animation:!0,confirmButtonClass:"btn btn-light-primary font-weight-bold",cancelButtonClass:"btn btn-transparent-danger font-weight-bold",confirmButtonText:"Sil",cancelButtonText:"İptal",showCancelButton:!0}).then(i=>{if(i.isConfirmed){let a=e.data("uuid"),n="/admin/dashboard/surveys/destroy";axios.delete(n,{data:{survey_uuid:a}}).then(t=>{t.status===200&&(success(t),$("#survey_datatable").DataTable().ajax.reload())}).catch(t=>{error(t)})}})});
